import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, TextInput, TouchableOpacity, View, Modal} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import React, {useState} from 'react';
import { MaterialIcons } from '@expo/vector-icons';
import Icon from 'react-native-vector-icons/AntDesign';

//For this screen maybe have a modal form. So a plus sign at the top of the screen then "your existing submissions"
//below that. Use matrial icons for the plus button and learn animation styles for that

export default function Finder({route}) {
    const {id} = route.params;
    return (
        <View style={styles.titleContainer}>
            <Text style={styles.title}>Welcome to finder page {id.name}. Here you can log a new location you found.</Text>
            <TouchableOpacity>
                <Icon
                    name='pluscircle'
                    size = {50}
                    style = {styles.addButton}
                    />
            </TouchableOpacity>

            <View>

                <Text>Give a title for your location</Text>
                <Text>Upload up to five photos</Text>
                <Text>Write a description</Text>
                    <View>
                        <TextInput/>
                    </View>
                <Text></Text>
            </View>
        </View>

    );
}

const styles = StyleSheet.create({
    titleContainer: {
      flex: 1,
      backgroundColor: 'white',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {
        fontWeight: 'bold',
        padding: 30
    },
    addButton: {
        alignItems: 'center'
    }
});
